('6150010500', '01200001', 'รองผู้บังคับกองร้อยปฏิบัติการสื่อสารพิเศษ กองพันทหารสื่อสารกองบัญชาการกองทัพไทย กรมการสื่อสารทหาร', 'รอง ผบ.ร้อย.ปสพ.พัน.ส.บก.ทท.สส.ทหาร', '09', 'ร.อ.', '', '412124000020', 1964, '6150000000', '6150010000', '6150010500', 1),
